import React from 'react';

class Footer extends React.Component {
    render() {
        return (
            <div className='container'>
                <div className='row align-items-center'>
                    <div className='col-md-12'>
                        <h2>FOOTER</h2>
                    </div>
                </div>
            </div>
        )
    }
}

export default Footer;
